  \"2015-01-22T15:57:28.122000\",\n\t\"name\": \"choice-grantees\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Choice Neighborhoods grants transform distressed
  neighborhoods, public and assisted projects into viable and sustainable mixed-income
  neighborhoods by linking housing improvements with appropriate services, schools,
  public assets, transportation, and access to jobs. A strong emphasis is placed on
  local community planning for access to high-quality educational opportunities, including
  early childhood education. Choice Neighborhoods grants build upon the successes
  of public housing transformation under HOPE VI to provide support for the preservation
  and rehabilitation of public and HUD-assisted housing, within the context of a broader
  approach to concentrated poverty. In addition to public housing authorities, the
  initiative will involve local governments, non-profits, and for-profit developers
  in undertaking comprehensive local planning with residents and the community.\",\n\t\"license_title\":
